import Grid from '@mui/material/Grid';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';

function Parallel() {
    const chargerElements = [];
    var ab=1
    var i=0
    var z=0
      for (let j = 0; j <49; j++) {
        z=j%4;
        // for (let i = 1; i<=5; i++) {
            if(z==0){
                i++
            }

          const element = (
            <>

            <div
              key={`charger${ab}`} 
              id={`charger${ab}`}
              style={{
                // Add other styles here
                backgroundColor: '#cbcbcb',
                // border: '5px',
                // borderStyle: 'solid',
                color: 'white',
                // zIndex: 
                textAlign:'right',

                // borderColor:'#FCE205',
                fontSize:"18px",
                position: 'absolute',
                width: '5%',
                borderRadius:10,
                height:'25px',
                // Set the width and position based on j and i
                left: `${18+(z * 6)}%`, 
                top: `${2+(i * 8)}%`,
              }}
            >
              {i%2!=0?<div style={{height:10,width:'120%',margin:'auto',backgroundColor:'blue',marginTop:'42px'}}></div>:null}

              {i%2!=0?<p style={{marginTop:'-50px'}}>{ab++}</p>:<>{ab++}</>}
              {/* {ab} */}
              {/* {i==9?<div style={{width:'120%',height:1,border:'solid 2px black',marginBottom:'-25px'}}/>:null} */}


              {/* {j}{i} */}
            </div>
            </>
          );

          chargerElements.push(element);

        // <hr style={{width:'100%',top:60}}/>
      }
    return (
      <div className="App">
        <Grid container >
        <Grid  xs={10}>
  {chargerElements}
  </Grid>
  <Grid xs={2} style={{backgroundColor:'lightgray',border:'3px solid gray',height:'100vw'}}>

    <Grid style={{backgroundColor:'#3879F6',height:50,marginTop:'-12px',marginTop:'10',padding:'10px',paddingLeft:'80px'}}><h3 style={{color:'white',margin:'auto'}}>CUSTOMISE</h3></Grid>
    <Grid>
<h5 style={{marginLeft:10,color:'gray'}}>ADD VEHICLES + </h5>
<Grid>

<Button variant="outlined" style={{borderColor:'grey'}}>+1</Button>
</Grid>
    </Grid>
  </Grid>
  </Grid>

      </div>
    );
  }

  export default Parallel;
